import './App.css';
import Movigfdes from './pages/Movies.tsx';
import Seats from './pages/Seats.tsx';
import UserInfo from './pages/UserInfo.tsx';
import Confirmation from './pages/Confirmation.tsx';
import CookieIsValid from './components/CookieIsValid.tsx';
import {BrowserRouter, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
        <Routes>
            <Route path='/' element={<Movies />} />
            <Route element={<CookieIsValid />}>
                <Route path='/seats' element={<Seats />} />
                <Route path='/user-information' element={<UserInfo />} />
                <Route path='/ticket-reservation-confirmation' element={<Confirmation />} />
            </Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
